import { gql, useQuery } from '@apollo/client';
import './PastLaunches.css';
import imgUnavailable from './../../../Assets/img_unavailable.jpg';

const GET_MISSIONS = gql`
{
    launchesPast(limit: 8) {
      links {
        article_link
        wikipedia
        video_link
        mission_patch_small
      }
      rocket {
        rocket_name
      }
      launch_year
      details
    }
  }
`;

export default function ProgramDetails() {
    const { loading, error, data } = useQuery(GET_MISSIONS);
    if (loading) return 'Loading...';
    if (error) return `Error! ${error.message}`;
    console.log(data.launchesPast);
  
    return (
        <>
            <h1 className="heading">OUR PAST LAUNCHES</h1>
            <div className="launch-grid">
                {data.launchesPast.map((launch,key) => {
                    return (
                        <div className="card" key={key}>
                                <img className="missionImg" src={launch.links.mission_patch_small} alt="imgMission" />
                            <div>
                                <h4><b>Mission {key+1}</b></h4> 
                                <p>{launch.launch_year}</p> 
                                <p>{launch.rocket.rocket_name}</p> 
                            </div>
                        </div>
                    );
                })}
            </div>
        </>
    );
}
